"use strict";

const accumulate = (arr) => {
  let sum = 0;
  return arr.map((val) => (sum += val));
};

const maximumSumScore = (nums) => {
  const s = [0, ...accumulate(nums)];
  return Math.max(
    ...Array.from({ length: nums.length }, (_, i) => {
      return Math.max(s[i + 1], s[s.length - 1] - s[i]);
    })
  );
};
